      SELECT DISTINCT + 96 / cor0.col0 + col1 * 95 + - 90 / - cor0.col1 AS col1 FROM tab0 (FORMAT parquet) AS cor0;
  - name: tab0

outputs:
  - name: q229.out
    data: |
      8175
      8646
      9217
